# Below is the updated version of the same code, where the user messages are right-aligned
# and the AI messages are left-aligned. We achieve this by wrapping each message in a container
# (".user-message" / ".ai-message") and using CSS flexbox to align them differently.
# In addition, we tweak the text alignment accordingly.

from uuid import uuid4
import streamlit as st

# We'll store messages in st.session_state for dynamic updates.
# We define separate functions for user messages and AI messages.

def render_user_message(text, timestamp=""):
    """Render a user message bubble on the chat UI, right-aligned."""
    st.markdown(
        f"""
        <div class="message-wrapper user-message">
            <div class="message-author">
                User
                <span class="message-time">{timestamp}</span>
            </div>
            <div class="chat-bubble user-bubble">
                {text}
            </div>
        </div>
        """,
        unsafe_allow_html=True
    )


def render_ai_message(text, timestamp=""):
    """Render an AI (assistant) message bubble on the chat UI, left-aligned."""
    st.markdown(
        f"""
        <div class="message-wrapper ai-message">
            <div class="message-author">
                <img src="data:image/png;base64,"
                     alt="AI Logo"
                     style="width: 24px; height: 24px; border-radius: 50%; vertical-align: middle;"
                />
                <span class="message-time">{timestamp}</span>
            </div>
            <div class="chat-bubble ai-bubble">
                {text}
            </div>
            <div class='actions-row'>
                <span class='action-item'>👍</span><span class='action-item'>👎</span><span class='action-item'>📋</span>
            </div>
        </div>
        """,
        unsafe_allow_html=True
    )
    st.button("click me", key=uuid4())


def collapsible_prompts_section():
    """Renders the collapsible prompts section. We rely on a JavaScript function to toggle visibility."""
    st.markdown(
        """
        <div class="prompt-toggle" onclick="togglePrompts()">
          <span id="prompt-toggle-text">Hide suggested prompts</span>
          <span class="chevron" id="prompt-chevron">▼</span>
        </div>
        <div class="prompt-container" id="prompt-container">
          <div class="prompt-button">Summarize recent messages in this chat</div>
          <div class="prompt-button">List the recent action items in this chat</div>
          <div class="prompt-button">Write a short message to share gratitude</div>
          <div class="prompt-button">Summarize new messages in this chat</div>
        </div>
        <script>
        function togglePrompts() {
            let container = document.getElementById("prompt-container");
            let toggleText = document.getElementById("prompt-toggle-text");
            let chevron = document.getElementById("prompt-chevron");
            if (container.style.display === "none") {
                container.style.display = "flex";
                toggleText.textContent = "Hide suggested prompts";
                chevron.textContent = "▼";
            } else {
                container.style.display = "none";
                toggleText.textContent = "Show suggested prompts";
                chevron.textContent = "▶";
            }
        }
        </script>
        """,
        unsafe_allow_html=True
    )


def app_layout():
    """Injects custom CSS, sets up container layout, top bar, and chat area."""
    st.set_page_config(page_title="Modular Chat UI", layout="wide")

    custom_css = """
    <style>
    html, body, [data-testid="stAppViewContainer"], main.stApp {
        height: 100%;
        margin: 0;
        padding: 0;
    }

    [data-testid="stToolbar"], footer, header {
        visibility: hidden;
        height: 0;
        max-height: 0;
        position: absolute;
    }

    main.stApp {
        display: flex;
        flex-direction: column;
        align-items: stretch;
    }
    
    h1 {
        text-align: center;
    }

    section.stMain .block-container {
        padding-top: 0rem;
    }

    /* SCROLLABLE MESSAGES AREA */
    .chat-area {
        flex: 1;
        overflow-y: auto;
        background-color: #fff;
        padding-top: 1rem;
        font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, Helvetica, Arial, sans-serif;
    }

    /* CONSTRAIN CONTENT WIDTH */
    .chat-container {
        max-width: 700px;
        margin: 0 auto;
        padding: 0 1rem 1rem 1rem;
    }

    /* MESSAGE BUBBLES */
    .message-wrapper {
        margin-bottom: 1.25rem;
        display: flex;
        flex-direction: column;
    }
    .message-author {
        font-weight: 600;
        margin-bottom: 0.25rem;
        color: #555;
        font-size: 14px;
    }
    .message-time {
        font-size: 13px;
        color: #999;
        margin-left: 0.5rem;
    }
    .chat-bubble {
        border-radius: 6px;
        padding: 0.5rem 0.75rem;
        font-size: 15px;
        line-height: 1.2;
        margin-top: 0.25rem;
        border: 1px solid #eee;
        max-width: 70%;
    }

    /* AI message: left-aligned */
    .ai-message {
        align-items: flex-start;
        text-align: left;
    }
    .ai-bubble {
        background-color: #f0f9ff;
        border-color: #bee3f8;
        margin-right: auto; /* push bubble to the left */
    }

    /* USER message: right-aligned */
    .user-message {
        align-items: flex-end;
        text-align: left;
    }
    .user-bubble {
        background-color: #f4f4f8;
        margin-left: auto; /* push bubble to the right */
    }

    /* ACTIONS (Sources, thumbs, etc.) */
    .actions-row {
        display: flex;
        align-items: center;
        margin-top: 0.25rem;
        font-size: 14px;
        color: #666;
    }
    .actions-row .action-item {
        margin-right: 1rem;
        cursor: pointer;
    }
    .actions-row .action-item:hover {
        text-decoration: underline;
    }

    /* PROMPT TOGGLER */
    .prompt-toggle {
        display: flex;
        align-items: center;
        padding: 0.5rem 1rem;
        font-size: 14px;
        color: #666;
        background-color: #f8f9fa;
        border-top: 1px solid #ddd;
        border-bottom: 1px solid #ddd;
        cursor: pointer;
        user-select: none;
        font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, Helvetica, Arial, sans-serif;
    }
    .prompt-toggle .chevron {
        margin-left: 0.5rem;
        transition: transform 0.2s ease-in-out;
    }

    /* STICKY PROMPTS ABOVE CHAT INPUT */
    .prompt-container {
        position: sticky;
        bottom: 65px; /* keep space for the pinned chat_input below */
        display: flex;
        gap: 0.5rem;
        flex-wrap: wrap;
        background-color: #f8f9fa;
        border-bottom: 1px solid #ddd;
        padding: 0.75rem 1rem;
        font-size: 14px;
        font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, Helvetica, Arial, sans-serif;
    }
    .prompt-button {
        background-color: #fff;
        border: 1px solid #ccc;
        padding: 0.5rem 0.75rem;
        border-radius: 4px;
        cursor: pointer;
        font-size: 14px;
        color: #333;
    }
    .prompt-button:hover {
        background-color: #fafafa;
    }

    /* OVERRIDES FOR st.chat_input() WIDGET */
    [data-testid="stChatInputContainer"] {
        border-top: 1px solid #ddd !important;
        background-color: #f8f9fa !important;
        padding: 0.5rem 1rem !important;
        font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, Helvetica, Arial, sans-serif;
    }
    [data-testid="stChatInputContainer"] textarea {
        background-color: #fff !important;
        border: 1px solid #ccc !important;
        border-radius: 4px !important;
        padding: 0.5rem !important;
        font-size: 14px !important;
        margin-right: 0.5rem !important;
        width: calc(100% - 90px) !important; /* leave room for 'Send' button */
        min-height: 40px !important;
        max-height: 80px !important;
    }

    /* SCROLLBAR STYLING (optional) */
    ::-webkit-scrollbar {
        width: 8px;
    }
    ::-webkit-scrollbar-track {
        background: #f1f1f1;
    }
    ::-webkit-scrollbar-thumb {
        background: #ccc;
    }
    </style>
    """

    st.markdown(custom_css, unsafe_allow_html=True)

    st.title("AI Companion")

    # Create chat area
    st.markdown('<div class="chat-area"><div class="chat-container">', unsafe_allow_html=True)


def close_chat_layout():
    st.markdown('</div></div>', unsafe_allow_html=True)


# We'll store messages in st.session_state["messages"]
# each message is a dict: {"type": "user"|"ai", "content": str, "timestamp": str}


def add_user_message(content, timestamp=""):
    if "messages" not in st.session_state:
        st.session_state["messages"] = []
    st.session_state["messages"].append({
        "type": "user",
        "content": content,
        "timestamp": timestamp
    })


def add_ai_message(content, timestamp=""):
    if "messages" not in st.session_state:
        st.session_state["messages"] = []
    st.session_state["messages"].append({
        "type": "ai",
        "content": content,
        "timestamp": timestamp
    })


def render_messages():
    if "messages" not in st.session_state:
        st.session_state["messages"] = []
    for msg in st.session_state["messages"]:
        if msg["type"] == "user":
            render_user_message(msg["content"], msg["timestamp"])
        else:
            render_ai_message(msg["content"], msg["timestamp"])


def main():
    app_layout()

    # Render existing messages from session_state
    render_messages()

    # Close chat layout so that subsequent elements (prompts & chat_input) are pinned below.
    close_chat_layout()

    # Render collapsible prompts section
    collapsible_prompts_section()

    # st.chat_input for user messages
    user_message = st.chat_input("Write a message or type / for more")
    if user_message:
        add_user_message(user_message, "Now")
        # For demonstration, let's automatically respond
        add_ai_message(f"Echo: {user_message}", "Now")
        st.rerun()


if __name__ == "__main__":
    main()
